tables.table_schema:
CREATE TABLE market_trends (
	trend_id UUID PRIMARY KEY,
	timestamp TIMESTAMP,
	trend VARCHAR(255),
	impact DECIMAL
);

CREATE TABLE traders ( 
 trader_id UUID PRIMARY KEY, 
 first_name VARCHAR(255), 
 last_name VARCHAR(255), 
 email VARCHAR(255) UNIQUE 
 );

CREATE TABLE trade_participants (
   participant_id SERIAL PRIMARY KEY,
   participant_name VARCHAR(100) NOT NULL,
   participant_type VARCHAR(50) NOT NULL
);

CREATE TABLE trade_analysis (
   analysis_id SERIAL PRIMARY KEY,
   trade_id INT REFERENCES trade_data(trade_id),
   participant_id INT REFERENCES trade_participants(participant_id),
   analysis_result TEXT
);

CREATE TABLE trade_market (
   market_id SERIAL PRIMARY KEY,
   market_name VARCHAR(100) NOT NULL,
   market_location VARCHAR(100)
);

CREATE TABLE trade_data (
    trade_id INT PRIMARY KEY,
    symbol VARCHAR(255) NOT NULL,
    trade_date DATE NOT NULL,
    trade_price DECIMAL(10, 2) NOT NULL
);

CREATE TABLE market_data (
    market_id INT PRIMARY KEY,
    market_name VARCHAR(255) NOT NULL
);

CREATE TABLE market_trends (
    trend_id INT PRIMARY KEY,
    trend_name VARCHAR(255) NOT NULL,
    trend_description TEXT
);
